import {
    AppBar, Toolbar, Typography 
} from "@material-ui/core";

function Header() {
    return(
        <div>
            <AppBar>
                <Toolbar>
                   <Typography variant="h6"></Typography>
                </Toolbar>
            </AppBar>
        </div>
    );
} export default Header;
